import logo from './logo.svg';
import './App.css';
import Hello from './components/Greet'
import { Bye } from './components/Greet'
import Welcome from './components/Welcome'

function App() {
  return (
    <div className="App">
      <Welcome>
      <button onClick={()=> change()}>Subscribe</button>
      </Welcome>
    </div>
  );
}
function change() {
  let w = new Welcome();
  if(w.state.message == "Welcome visitor"){
      w.setState({message:"thanks for subscribing"})
  }
  else{
      w.setState({message:<Hello/>});
  }
}

export default App;
